INSERT INTO `proc` VALUES ('rmp','sp_import_translations','PROCEDURE','sp_import_translations','SQL','CONTAINS_SQL','NO','DEFINER','IN _from_language_id INT(11),IN _to_language_id INT(11)','','BEGIN\n    DECLARE bDone INT;\n    DECLARE trans_key VARCHAR(50);  \n    DECLARE trans_value VARCHAR(50); \n    DECLARE trans_group VARCHAR(50);\n    DECLARE curs CURSOR FOR  SELECT `key`,`value`,`group` FROM `translations` WHERE `language_id` = _from_language_id;\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET bDone = 1;\n    OPEN curs;\n    SET bDone = 0;\n    REPEAT\n        FETCH curs INTO trans_key,trans_value,trans_group;\n        INSERT INTO translations(`key`,`value`,`group`,`language_id`) \n            VALUES (trans_key,trans_value,trans_group,_to_language_id);\n    UNTIL bDone END REPEAT;\n    CLOSE curs;\n	SELECT COUNT(`id`) AS `total` FROM `translations` WHERE `language_id` = _to_language_id;\nEND','root@localhost','2016-02-18 12:35:24','2016-02-18 12:35:24','NO_ENGINE_SUBSTITUTION','','utf8','utf8_unicode_ci','utf8_unicode_ci','BEGIN\n    DECLARE bDone INT;\n    DECLARE trans_key VARCHAR(50);  \n    DECLARE trans_value VARCHAR(50); \n    DECLARE trans_group VARCHAR(50);\n    DECLARE curs CURSOR FOR  SELECT `key`,`value`,`group` FROM `translations` WHERE `language_id` = _from_language_id;\n	DECLARE CONTINUE HANDLER FOR NOT FOUND SET bDone = 1;\n    OPEN curs;\n    SET bDone = 0;\n    REPEAT\n        FETCH curs INTO trans_key,trans_value,trans_group;\n        INSERT INTO translations(`key`,`value`,`group`,`language_id`) \n            VALUES (trans_key,trans_value,trans_group,_to_language_id);\n    UNTIL bDone END REPEAT;\n    CLOSE curs;\n	SELECT COUNT(`id`) AS `total` FROM `translations` WHERE `language_id` = _to_language_id;\nEND');
