INSERT INTO `contract_articles` VALUES (3,'Contract Duration:','مدة العقد:','<p>The Second Party shall commence work for the First Party with effect from the date of embarkation and shall continue until June 1st, 2015 or until the end of the Academic Year 2014-2015; whichever comes later depending on the needs of the University. This contract shall be renewed automatically for another academic year unless notified otherwise one month prior to the end of the Contract.</p>','<p>سيبدأ عمل الطرف الثاني لدى الطرف الأول اعتباراً من مباشرته للعمل وسيستمر حتى تاريخ 1 يونيو 2015 أو بانتهاء السنة الأكاديمية 2014-2015 أيهما أبعد وفقا لحاجة الجامعة وسيتم تجديده تلقائيا لسنة أكاديمية أخرى ما لم يتم اخطاركم قبل نهاية العقد بشهر بخلاف ذلك.</p>',0,1,1,'2014-07-31 21:14:23','2014-08-14 13:21:23'),(4,'Probation Period:','فترة التجربة:','<p>The first three months of this Contract is deemed probationary.</p>','<p>تعتبر الثلاثة أشهر الأولى من هذا العقد فترة تجريبية.</p>',0,1,1,'2014-07-31 21:15:37','2014-08-14 13:22:15'),(5,'','','<p>The Second Party shall work for the First Party under the job title of <strong>{{job_title}}</strong>.</p>','<p>يعمل الطرف الثاني لدى الطرف الاول بوظيفة&nbsp;<strong style=\"box-sizing: border-box; font-family: \'Open Sans\', sans-serif; font-size: 12px; line-height: 16.71428680419922px;\">{{job_title_arabic}}</strong>.</p>',0,2,1,'2014-07-31 21:18:12','2014-08-26 19:12:36'),(6,'','','<p>The workplace is located at <strong>King Khalid&nbsp;university</strong> (located in <strong>Abha</strong>&nbsp;/ Saudi Arabia). (hereinafter referred to as &ldquo;The University&rdquo;).</p>','<p>إن مقر العمل هو <strong>جامـعة الملـك خـالـد</strong>&nbsp;( التي تقع في مدينة <strong>أبها</strong>&nbsp;/ المملكة العربية السعودية ) ويشار اليه لاحقا بـــ (الجامعة) .</p>',0,3,1,'2014-07-31 21:20:56','2014-08-17 12:46:38'),(7,'Monthly Salary:','الراتب الشهري:','<p>The monthly basic salary of (<strong style=\"box-sizing: border-box; font-family: \'Open Sans\', sans-serif; font-size: 12.222222328186035px; line-height: 18.571430206298828px;\"><strong style=\"box-sizing: border-box;\">{{full_basic_salary}}</strong>)</strong>&nbsp;Saudi Riyals shall be paid on the last day of every month for the duration of the contract&nbsp;period.</p>','<p>يبلغ الراتب الأساسي الشهري طوال مدة سريان هذا العقد&nbsp;<strong style=\"box-sizing: border-box; font-family: \'Open Sans\', sans-serif; font-size: 12.222222328186035px; line-height: 18.571430206298828px;\"><strong style=\"box-sizing: border-box;\">{{full_basic_salary}}</strong>&nbsp;</strong><span style=\"font-size: 11px;\">ريالاً سعودياً ويدفع في اخر يوم من كل شهر ميلادي.</span></p>',0,4,1,'2014-07-31 21:23:07','2014-08-17 14:07:59'),(8,'Accommodation:','السكن:','<p>The Second Party shall receive either a housing allowance of&nbsp;{{housing_allowance}}. Saudi Riyals, or accommodation in the city of <strong>Abha</strong>, whichever the First Party finds appropriate. The First Party shall provide a written consent when the accommodation allowance is chosen by the Second Party.</p>','<p>يحصل الطرف الثاني على بدل سكن شهري قدره&nbsp;{{housing_allowance}}.ريال او تزويده بمقر للسكن في مدينة <strong>أبها</strong>&nbsp;المملكة العربية السعودية ، حسب ما يراه الطرف الاول مناسباً وبموافقة خطية من الطرف الأول للسكن خارج مقر سكن الطرف الاول.</p>',0,4,1,'2014-07-31 21:24:47','2014-08-17 20:29:02'),(9,'Transportation:','النقل والمواصلات:','<p>The Second Party shall receive either a transportation allowance of&nbsp;<strong style=\"box-sizing: border-box; font-family: \'Open Sans\', sans-serif; font-size: 12.222222328186035px; line-height: 18.571430206298828px;\">{{transportation_allowance}}</strong>&nbsp;Saudi Riyals, or a local transportation service (to and from workplace and accommodation). Providing accommodation and transportation in kind is inseparable and the Second Party shall not choose to receive one allowance and not the other.</p>','<p>يحصل الطرف الثاني على بدل نقل شهري قدره <strong style=\"box-sizing: border-box; font-family: \'Open Sans\', sans-serif; font-size: 12.222222328186035px; line-height: 18.571430206298828px;\">{{transportation_allowance}}</strong>&nbsp;ريال او تزويده بوسيلة نقل محلية ( بين مقر السكن ومقر العمل ) . توفير السكن و المواصلات العينية متصلان ببعضهما ولا يمكن اختيار أحدهما وترك الآخر</p>',0,4,1,'2014-07-31 21:25:56','2014-08-17 20:27:10'),(13,'Total salary:','إجمالي الراتب:','<p><strong>{{total_salary}}</strong> Saudi Riyals.</p>','<p><strong style=\"font-size: 11px;\">{{total_salary}}&nbsp;</strong>ريالاً سعودياً.</p>',0,4,1,'2014-08-01 02:00:05','2014-08-17 19:41:25'),(14,'Airline Tickets:','تذاكر الطيران:','<p>The First Party shall issue two (2) international airline tickets for the Second Party during the Contract. The first ticket shall be on the arrival to the Kingdom of Saudi Arabia at the beginning of the Contract, and the second ticket is at the end of the contract departing from the city of <strong>Abha</strong>, Kingdom of Saudi Arabia(to the place of origin)</p>','<p>يقدم لك الطرف الأول خلال العقد تذكرتين طيران دولية ( الأولى عند القدوم الى المملكة العربية السعودية عند بداية العقد والاخرى عند نهاية عقد العمل انطلاقاً من مدينة <strong>ابها</strong>&nbsp;\" المملكة العربية السعودية \" إلى الموطن الأصلى).</p>',0,4,1,'2014-08-01 02:01:26','2014-08-17 12:51:42'),(15,'Agreement Between','اتفاق بين','<p>1) Quality Education Holding Company, represented herein by Mr. Nader Ahmed Alharbi in his capacity as Vice Executive President (hereinafter referred to as \"the First Party\")</p>\n<p>2) Name of contracting person: {{applicant_name}} of {{nationality}} nationality, holding passport No. {{passport_number}} and hereinafter referred to as \"the Second Party\".</p>','<p>1) شركة التعليم النوعي القابضة ويمثلها في هذا العقد السيد نادر أحمد الحربي، بصفته نائب الرئيس التنفيذي (ويشار اليه فيما بعد بتعبير الطرف الأول)</p>\n<p>2) اسم المتعاقد/ {{applicant_name_arabic}}&nbsp;الجنسية&nbsp;{{nationality_arabic}}&nbsp;جواز سفر رقم&nbsp;{{passport_number}}&nbsp;ويشار إليه فيما بعد بتعبير \" الطرف الثاني\"</p>',0,5,1,'2014-08-05 16:33:41','2014-08-17 13:42:01'),(16,'Annual Raise:','العلاوة السنوية:','<p>The Second Party is entitled to annual raise as calculated by the Company should the Contract be renewed.</p>','<p>يحق للطرف الثاني الحصول على علاوة سنوية تقدرها الشركة في حال تجديد العقد.</p>',0,4,1,'2014-08-05 19:43:52','2014-08-14 13:39:28'),(17,'','','<p>The academic year consists of two (2) semesters in addition to summer semester if requested by the University. Each semester has a total of eight (8) working hours per day (Sunday to Thursday); twenty-five (25) of them are weekly teaching hours and The remaining working hours shall be allocated for office work, lesson and teaching aids preparation, test correction and other administrative tasks without an additional pay.</p>','<p>مدة الدراسة فصلين دراسيين بالاضافة الى الترم الصيفي حال طلبت الجامعة ذلك . في كل فصل دراسي يتم العمل فيها بواقع (8 ساعات يوميا) من الأحد حتى الخميس وبموجب 25 ساعة تدريس في الأسبوع. وتخصص باقي ساعات العمل للأعمال المكتبية واعداد الدروس والوسائل التعليمية وتصحيح الاختبارات وغيرها من الامور الادارية بالقسم بدون أجر إضافي.</p>',0,6,1,'2014-08-05 19:45:13','2014-08-14 13:40:22'),(18,'','','<p>The Second Party shall be entitled to weekend (falling on Friday and Saturday) unless the First Party or University demands otherwise.</p>','<p>للطرف الثاني الحق في الحصول على الاجازة الأسبوعية يومي الجمعة والسبت (ما لم يتم مطالبته من الطرف الاول او الجامعة بخلاف ذلك).</p>',0,7,1,'2014-08-05 19:46:17','2014-08-14 13:41:27'),(19,'','','<p>The Second Party shall be entitled to all official public holidays in the Kingdom (The two Eids holidays and the National Day) according to the announced dates.</p>','<p>للطرف الثاني الحق في الحصول على الأجازات الرسمية بالمملكة (اجازة العيدين واليوم الوطني) حسب التواريخ المعلنة .</p>',0,7,1,'2014-08-05 19:47:16','2014-08-14 13:42:38'),(20,'','','<p>Any granted leave by the University will be paid only upon the First Party&rsquo;s approval.</p>','<p>أي اجازات خلال العام الدراسي ممنوحة من الجامعة تكون مدفوعة فقط عند موافقة الطرف الأول على ذلك .</p>',0,7,1,'2014-08-05 19:48:00','2014-08-14 13:42:29'),(21,'','','<p>Once the Second Party has finished the term of contract, the Second Party is entitled to thirty (30) days of annual leave but if the Second Party terminates the Contract before the end of the Contract., annual leave entitlement will be in proportion to 2.5 (two point five) days per month of service.</p>','<p>اذا بدأت العمل واتممت مدة العقد كاملة يتم حساب 30 يوما )بدل أجازة سنوية) أما إذا بدأت العمل و تركته قبل نهاية العقد يتم حساب استحقاقك عن الإجازة بواقع (2.5 ) يوماً عن كل شهر تمضيه في الخدمة .</p>',0,7,1,'2014-08-05 19:48:38','2014-08-14 13:43:14'),(22,'','','<p>The Second Party is entitled to be paid sick leave provided by the First Party as long as the Second Party abides by the required procedures including notifying the First Party about his/her illness and to provide supporting medical reports approved by the First Party) when any absence occurs due to sickness throughout the duration of this Contract.</p>','<p>يحق للطرف الثاني الحصول على راتب الإجازة المرضية المدفوعة الأجر الذي يمنحه الطرف الاول وذلك شريطة التزامه بالترتيبات المطلوبة لإبلاغ الطرف الأول عن المرض وبتقديم التقارير الطبية المؤيدة لذلك والمقبولة لدى الطرف الأول خلال أية فترة من فترات غيابك لأسباب طبية أثناء مدة هذا العقد.</p>',0,8,1,'2014-08-05 19:51:01','2014-08-14 13:44:11'),(23,'','','<p>The First Party has the right to deduct two days worth of salary from the Second Party in the following cases:&nbsp;</p>\n<p>-Unexcused absence by the Second Party: should absence exceeds two (2) days per semester, during the period of this Contract, , administrative penalties shall be applied as per the rules and regulations of the First Party.&nbsp;</p>\n<p>-If the Second Party is absent on any working day prior to or following any holiday - including weekends - unless a compelling reason has occurred with prior or later approval by the First Party.</p>','<p>يحق للطرف الأول خصم راتب يومين من الطرف الثاني في الحالات التالية:&nbsp;</p>\n<p>-في حالة غياب الطرف الثاني عن العمل بدون عذر وفي حالة تجاوز عدد أيام الغياب خلال فترة هذا العقد لأكثر من يومين بدون عذر في كل فصل دراسي فسوف يتم فرض جزاءات ادارية حسب لوائح وأنظمة الطرف الاول.&nbsp;</p>\n<p>-في حالة تغيب الطرف الثاني في أي يوم عمل متصل (سابق او لاحق) بأي أجازة بما فيها أجازة نهاية الأسبوع الا لسبب قهري وبعد قبول العذر من الطرف الأول مقدما او لاحقا.</p>',0,9,1,'2014-08-05 19:54:09','2014-08-17 13:48:55'),(24,'','','<p>&nbsp;The Second Party shall authorize The First Party to deduct from his or her salary the full employment fees if the Second Party resigned during the probation period.</p>','<p>&nbsp;يتم تفويض الطرف الأول بموجب هذا العقد بأن يستقطع تكاليف توظيف الطرف الثاني من راتب الطرف الثاني المستحق في حال استقالة الطرف الثاني أثناء فترة التجربة</p>',0,9,1,'2014-08-05 19:58:06','2014-08-17 13:48:21'),(25,'','','<p>The Second Party is not entitled to a return ticket if he/she resigns and terminates the Contract.</p>','<p>لا يحق للطرف الثاني الحصول على تذكرة الذهاب المقررة في حالة استقالته وعدم اكمال العقد.</p>',0,9,1,'2014-08-05 19:58:36','2014-08-14 13:47:19'),(26,'','','<p>Half a day&rsquo;s salary shall be deducted in the following cases:&nbsp;</p>\n<p>a) Attendance is not registered whether in writing or by using the fingerprint attendance system (if available).&nbsp;</p>\n<p>b) The Second Party does not complete eight (8) hours on campus daily, unless late arrival or early dismissal has previously been approved by both the University and the First Party\'s HR department.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','<p>سيتم خصم نصف يوم من الراتب في الحالات التالية:</p>\n<p>&nbsp;أ&zwnj;. اذا لم يتم توقيع الحضور والانصراف سواء خطيا او باستعمال جهاز البصمة (اذا توفر).&nbsp;</p>\n<p>ب&zwnj;. اذا لم يكمل الطرف الثاني عدد 8 ساعات يوميا بالجامعة الا اذا كانت حالة الحضور متأخرا او الخروج مبكرا موافق عليها مسبقا من الجامعة وقسم الموارد البشرية لدى الطرف الاول .</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>',0,9,1,'2014-08-05 20:01:24','2014-08-17 13:48:40'),(27,'','','<p>The First Party has the right to terminate the Contract with the Second Party at any time during or at the end of the probation period without prior notice or compensation if the Second Party fails to perform his or her duties as determined by the First Party or the University.</p>','<p>يجوز للطرف الأول إنهاء عقد عمل الطرف الثاني في أي وقت يشاء أثناء فترة التجربة أو بعد نهايتها بدون فترة اخطار مسبق او تعويض اذا فشل الطرف الثاني في اداء واجباته المحددة من الطرف الأول او الجامعة.</p>',0,10,1,'2014-08-05 20:02:34','2014-08-14 13:49:53'),(28,'','','<p>Once the probation period has ended, the First Party has the right to terminate the Contract prior to the end of the Contract by issuing a notice thirty (30) days prior to the date of discontinuation of work.</p>','<p>بعد انقضاء فترة التجربة يحق للطرف الاول انهاء العقد قبل مدة انقضائه بإصدار شعار قبل ثلاثين يوم من تاريخ توقف العمل.</p>',0,10,1,'2014-08-05 20:03:10','2014-08-14 13:50:44'),(29,'','','<p>The First Party has the right to terminate the Contract with the Second Party without any given notice/warning should he/she breaches the rules and regulations of this Contract, or if any of the following has occurred:</p>\n<p>&bull; Disgraceful conduct including unreasonable conduct (e.g. unprofessional or dangerous conduct towards students or colleagues).</p>\n<p>&bull; Being inconsiderate towards the safety the students and colleagues.</p>\n<p>&bull; Any behavior deemed by the First Party as a legal infringement of the employment Contract of the Second Party.</p>\n<p>&bull; Dishonesty, forgery or theft.</p>\n<p>&bull; Violation of confidentiality of the First Party.</p>\n<p>&bull; Consumption of alcohol, prescribed drugs, or any narcotic substances at place of work</p>\n<p>&bull; Blatant disobedience of instructions given by individuals higher in rank and position than the Second Party which results in intentional physical damage, threat or bullying.</p>\n<p>&bull; Harassment of the students, colleagues, or superior officers at the place of work.</p>\n<p>&bull; Inflicting damage to property of the First Party, students or colleagues.</p>','<p>يحق للطرف الأول إنهاء عقد عملك من دون إعطائك مهلة / فترة انذار إذا قمت بخرق شروط هذا العقد وأحكامه أو في حالة ارتكابك التالي:</p>\n<p>&bull; سلوك مشين ويشمل هذا السلوك الجسيم ( على سبيل المثال ) السلوك غير المهني والخطير أتجاه الطلبة أو الزملاء .</p>\n<p>&bull; عدم الاهتمام بسلامة الطلبة أو الزملاء .</p>\n<p>&bull; أي مخالفة قانونية يراها الطرف الأول بصورة معقولة ذات صلة بعقد عمل الطرف الثاني .</p>\n<p>&bull; عدم الأمانة او التزوير أو السرقة . &bull; البوح بأسرار الطرف الاول .</p>\n<p>&bull; تعاطي المشروبات الكحولية أو العقاقير التي تصرف بوصفات طبية أو أية مواد مخدرة أخرى في موقع العمل .</p>\n<p>&bull; العصيان الصارخ للأوامر المعقولة التي تصدر عن الأشخاص الأعلى منك مرتبة ومنصباً ومما يتسبب في الحاق الأذي الجسدي الفعلي أو التهديدي / المنذر أو الأستقواء غير المشروع .</p>\n<p>&bull; التحرش بالطلبة او الزملاء او رؤساء العمل .</p>\n<p>&bull; التسبب في إلحاق الضرر بممتلكات كل من الطرف الأول أو الطلبة أو الزملاء.</p>',0,10,1,'2014-08-05 20:05:18','2014-08-14 13:52:38'),(30,'','','<p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt -0.95pt; text-align: justify; text-indent: 0.95pt; direction: ltr; unicode-bidi: embed; background-position: initial initial; background-repeat: initial initial;\"><span style=\"font-size: 8pt; font-family: Euphemia, sans-serif;\">Upon the request of First Party, and in the event of the Second Party terminating his/her Contract, the Second Party shall be required to return the property of the First Party.</span></p>','<p>بناء على طلب الطرف الأول وفي حالة إنهاء عقد عملك لأي سبب كان فأنت مطالب بإعادة ممتلكات الطرف الأول إليه.</p>',0,11,1,'2014-08-05 20:53:17','2014-08-14 13:53:45'),(31,'','','<p class=\"MsoNormal\" style=\"margin: 0in 0in 0.0001pt -0.95pt; text-align: justify; text-indent: 0.95pt; direction: ltr; unicode-bidi: embed; background-position: initial initial; background-repeat: initial initial;\"><span style=\"font-size: 8pt; font-family: Euphemia, sans-serif;\">Educational and other work material produced by the Second Party during the period of his/her Contract shall remain the property of the First Party at all times. Moreover, the First Party shall reserve all design rights (and other rights of similar nature globally) invoked for material of any description during the period of the Second Party\'s Contract with the First Party or any related period.</span></p>','<p>تبقى المواد التعليمية ومواد العمل الأخرى التي ينتجها الطرف الثاني أثناء فترة عقد عمله ملكاً للطرف الأول وكذلك حق التصميم والحقوق ذات الطبيعة المماثلة الأخرى في كل انحاء العالم في الأعمال التي انتجت تحت أي توصيف لها أثناء مدة عقد عمل الطرف الثاني لدى الطرف الاول أو ترتبط به .</p>',0,11,1,'2014-08-14 13:54:09','2014-08-14 13:54:09'),(32,'','','<p><span style=\"font-size: 8pt; line-height: 115%; font-family: Euphemia, sans-serif;\">If The Second Party invents or presents any invention (whether or not a patent application has been filed) during his/her Contract, he/she shall immediately disclose all information about said invention to The First Party and shall not disclose the details or the nature of the invention to any other party. Upon termination of the Contract of the Second Party for any reason, he/she shall be required to confirm that he/she has disclosed the full details of said invention to the First Party and that the </span><span style=\"font-size: 9.0pt; line-height: 115%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-bidi-font-family: Arial; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">First</span> <span style=\"font-size: 8pt; line-height: 115%; font-family: Euphemia, sans-serif;\">Party shall solely own all inventions. This shall be subject to any legal rights.&nbsp;</span></p>','<p>إذا ابتكر الطرف الثاني أو تقدم بأي اختراع سواء أكان قابلاً للتسجيل كبراءة اختراع أم لا أثناء مدة عقد عمله يجب عليه على الفور الإفصاح عن كامل تفاصيل ذلك الإختراع ويجب أن لا يفصح عن تفاصيل وجود ذلك الإختراع وعن طبيعته لأي شخص آخر . وعند انهاء عقد عمل الطرف الثاني لأي سبب كان فهو مطالب بتأكيد افصاحه للطرف الأول عن كامل تفاصيل ذلك الإختراع ويمتلك الطرف الأول وحده كل تلك الإختراعات على أن يخضع ذلك لأي حقوق قانونية.</p>',0,11,1,'2014-08-14 13:54:48','2014-08-14 13:54:48'),(33,'','','<p>The Second Party should not work with any other party during the period of the Contract with the First Party.</p>','<p>لا يحق للطرف الثاني العمل مع أي جهة أخرى خلال فترة تعاقده لدى الطرف الاول.</p>',0,12,1,'2014-08-14 13:55:37','2014-08-14 13:55:37'),(34,'','','<p>The Second Party, whose Contract has been signed outside the Kingdom, shall not request sponsorship transfer to other companies.</p>','<p>لا يحق للطرف الثاني، الذي تم التعاقد معه من خارج المملكة، طلب نقل كفالتة لأي منشأة أخرى.</p>',0,12,1,'2014-08-14 13:56:01','2014-08-14 13:56:01'),(35,'','','<p>The First Party has the right to request all certificates and qualifications of the employees from time to time.</p>','<p>يحق للطرف الاول طلب جميع شهادات ومؤهلات الموظفين من وقت إلى آخر.</p>',0,12,1,'2014-08-14 13:56:38','2014-08-14 13:56:38'),(36,'','','<p>This contract is valid with effect from the first day the Second Party commences work in Kingdom of Saudi Arabia.</p>','<p>العقد يعتبر ساري من تاريخ مباشرة الطرف الاول العمل في المملكة العربية السعودية.</p>',0,12,1,'2014-08-14 13:57:03','2014-08-14 13:57:03'),(37,'','','<p>The Second Party hereby acknowledges that his/her employment with the First Party is subject to the approval and consent of the University, and that if the University at any point expresses its dissatisfaction with the services rendered by The Second Party, the First Party has the right to carry out any action deemed appropriate, whether by terminating his/her services, or by fining him/her as a result of the violations. In such an eventuality, the First Party shall not hold any responsibilities towards the Second Party for damages.</p>','<p>يقر الطرف الثاني بأن عمله لدى الطرف الاول وفقا لهذا العقد يخضع لموافقة ورضاء الجامعة وأنه اذا أبدت الجامعة عدم رضاها عن خدمات الطرف الثاني في أي وقت من الأوقات فإن للطرف الاول الحق في اتخاذ ما يراه مناسبا في حق الطرف الثاني من انهاء خدماته فورا او تغريمه نتيجة ما ارتكب من مخالفات وفي حال حصول هذا الإحتمال فإن الطرف الاول لا يتحمل أي مسؤولية تجاه الطرف الثاني عن أي أضرار تنتج عن ذلك.</p>',0,12,1,'2014-08-14 13:57:33','2014-08-14 13:57:33'),(38,'','','<p>Any discord arising from this Contract or any of its items shall be settled amicably.</p>\n<p>&nbsp;</p>','<p>أي خلاف ينشأ بسبب العقد أو أي من بنوده سيتم حله وديا.</p>',0,13,1,'2014-08-14 13:59:08','2014-08-14 13:59:08'),(39,'','','<p>Where there is any discrepancy in translation within the contract, the Arabic version is to be preferred.</p>','<p>في حال وجود أي اختلاف أو تناقض في ترجمة العقد للغة الانجليزية يتم الأخذ بالنسخة العربية من العقد.</p>',0,13,1,'2014-08-14 13:59:29','2014-08-14 14:35:27'),(40,'','','<p>This Contract contains the entire and sole Agreement between the two Parties and supersedes all prior arrangements between the First and Second parties.</p>','<p>يحتوي هذا العقد على الاتفاقية الكاملة والوحيدة بين الطرفين وهي تنسخ جميع الترتيبات السابقة بين الطرف الاول والثاني.</p>',0,14,1,'2014-08-14 14:00:26','2014-08-14 14:00:26'),(41,'','','<p>This contract is produced in two duplicates, with each party holding one true copy to follow when necessary.</p>','<p>حرر هذا العقد من نسختين بيد كل طرف نسخة للعمل بموجبها عند اللزوم.</p>',0,14,1,'2014-08-14 14:00:59','2014-08-14 14:00:59'),(43,'Health Insurance:','التأمين الصحي:','<p><span style=\"font-size: 8pt; line-height: 115%; font-family: Euphemia, sans-serif; letter-spacing: -0.05pt;\">Health Insurance (class B) shall be provided for the Second Party.</span></p>','<p style=\"text-align: right;\">يحصل الطرف الثاني على تأمين الصحي (فئة&nbsp;ب).&nbsp;</p>',0,4,1,'2014-08-17 19:40:17','2014-09-11 21:45:25'),(44,'fef ','dwd','<p>fef</p>','<p>dwdwd</p>',0,15,1,'2015-11-06 01:37:04','2015-11-06 01:37:04');
