INSERT INTO `delegated_tasks` VALUES (1,1,5,'Review Job Offer','<p>Dear Andrew,</p>\r\n<p><span style=\"font-size: 8.5pt; font-family: \'Verdana\',\'sans-serif\'; color: black;\">We are pleased to inform you that we can offer you a position with QEHC. Please log in to your account to review and respond to the offer. The validity of this offer is for two (2) days only.&nbsp;</span></p>\r\n<p><span style=\"font-size: 8.5pt; font-family: \'Verdana\',\'sans-serif\'; color: black;\">Ensure that your passport details have been entered on your profile and that you have uploaded your passport information page. Once we have received your accepted offer and your profile is complete, we will be able to generate a contract for you.</span></p>\r\n<p>Best regards,</p>\r\n<p>CompleteRMP Team.</p>',2,NULL,NULL,NULL,NULL,'2015-05-20 01:01:37','2015-05-20 02:17:40'),(2,NULL,5,'Review and sign contract.','<p>Dear Andrew,</p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">We are delighted that you have accepted our offer and your contract is now available for you to sign within the next three days.&nbsp;</span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Access your contract by clicking My Documents and&nbsp;accept it by clicking \"Agree and accept\" then \"Send contract decision\" (the green button).&nbsp;</span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Please print and sign each page, then upload to the portal in the signed contract field. (Depending on your scanner, you may have to submit each page separately: if so, please ensure you name each page appropriately.)</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Further information on the visa process will be sent to you soon. This will appear as a new task on your profile.</span></p>\r\n<p>Best regards,</p>\r\n<p>CompleteRMP Team</p>',2,NULL,NULL,NULL,NULL,'2015-05-20 02:18:02','2015-05-20 02:18:02'),(3,NULL,5,'Visa Process Started','<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Dear Andrew,</span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">You are now ready to begin the visa process!&nbsp; Please log in to your account to view the details for your visa agent. You need to check all requirements with the agent and ensure these are met so that your visa can be issued.</span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Best regards,<br /> CompleteRMP&nbsp;Team</span></p>',1,NULL,NULL,NULL,NULL,'2015-05-20 02:31:53','2015-05-20 02:31:53'),(4,NULL,5,'Update Flight Availability','Please click on the \"My Status\" link and update your flight availability. The link can be found under the visa agent details.',1,NULL,NULL,NULL,NULL,'2015-05-20 02:54:55','2015-05-20 02:54:55'),(5,1,105,'Review Job Offer','<p>Dear Karen,</p>\r\n<p><span style=\"font-size: 8.5pt; font-family: \'Verdana\',\'sans-serif\'; color: black;\">We are pleased to inform you that we can offer you a position with QEHC. Please log in to your account to review and respond to the offer. The validity of this offer is for two (2) days only.&nbsp;</span></p>\r\n<p><span style=\"font-size: 8.5pt; font-family: \'Verdana\',\'sans-serif\'; color: black;\">Ensure that your passport details have been entered on your profile and that you have uploaded your passport information page. Once we have received your accepted offer and your profile is complete, we will be able to generate a contract for you.</span></p>\r\n<p>Best regards,</p>\r\n<p>CompleteRMP Team.</p>',1,NULL,NULL,NULL,NULL,'2015-05-20 05:11:37','2015-05-20 05:11:37'),(6,1,119,'Review Job Offer','<p>Dear Leah,</p>\r\n<p><span style=\"font-size: 8.5pt; font-family: \'Verdana\',\'sans-serif\'; color: black;\">We are pleased to inform you that we can offer you a position with QEHC. Please log in to your account to review and respond to the offer. The validity of this offer is for two (2) days only.&nbsp;</span></p>\r\n<p><span style=\"font-size: 8.5pt; font-family: \'Verdana\',\'sans-serif\'; color: black;\">Ensure that your passport details have been entered on your profile and that you have uploaded your passport information page. Once we have received your accepted offer and your profile is complete, we will be able to generate a contract for you.</span></p>\r\n<p>Best regards,</p>\r\n<p>CompleteRMP Team.</p>',1,NULL,NULL,NULL,NULL,'2015-05-20 05:22:35','2015-05-20 05:22:35'),(7,1,199,'Review Job Offer','<p>Dear Leah,</p>\r\n<p><span style=\"font-size: 8.5pt; font-family: \'Verdana\',\'sans-serif\'; color: black;\">We are pleased to inform you that we can offer you a position with QEHC. Please log in to your account to review and respond to the offer. The validity of this offer is for two (2) days only.&nbsp;</span></p>\r\n<p><span style=\"font-size: 8.5pt; font-family: \'Verdana\',\'sans-serif\'; color: black;\">Ensure that your passport details have been entered on your profile and that you have uploaded your passport information page. Once we have received your accepted offer and your profile is complete, we will be able to generate a contract for you.</span></p>\r\n<p>Best regards,</p>\r\n<p>CompleteRMP Team.</p>',1,NULL,NULL,NULL,NULL,'2015-05-21 01:39:55','2015-05-21 01:39:55'),(8,NULL,199,'Review and sign contract.','<p>Dear Leah,</p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">We are delighted that you have accepted our offer and your contract is now available for you to sign within the next three days.&nbsp;</span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Access your contract by clicking My Documents and&nbsp;accept it by clicking \"Agree and accept\" then \"Send contract decision\" (the green button).&nbsp;</span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Please print and sign each page, then upload to the portal in the signed contract field. (Depending on your scanner, you may have to submit each page separately: if so, please ensure you name each page appropriately.)</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Further information on the visa process will be sent to you soon. This will appear as a new task on your profile.</span></p>\r\n<p>Best regards,</p>\r\n<p>CompleteRMP Team</p>',1,NULL,NULL,NULL,NULL,'2015-05-21 01:42:48','2015-05-21 01:42:48'),(9,NULL,13,'Please schedule your interview','<p class=\"p1\">Dear Austin,</p>\r\n<p>You have been shortlisted for an interview for one of our projects. We kindly request you to schedule a Skype&nbsp;interview appointment at a time convenient for you.&nbsp;</p>\r\n<p>Please log in to your account, click the &ldquo;Schedule Interview&rdquo; link in the left hand menu and complete the form. Please also ensure that your Skype ID has been&nbsp;added to your profile.</p>\r\n<p class=\"p1\">Best regards,<br /> CompleteRMP&nbsp;Team.</p>',1,NULL,NULL,NULL,NULL,'2015-05-21 04:04:05','2015-05-21 04:04:05'),(10,NULL,9,'Please schedule your interview','<p class=\"p1\">Dear Peter,</p>\r\n<p>You have been shortlisted for an interview for one of our projects. We kindly request you to schedule a Skype&nbsp;interview appointment at a time convenient for you.&nbsp;</p>\r\n<p>Please log in to your account, click the &ldquo;Schedule Interview&rdquo; link in the left hand menu and complete the form. Please also ensure that your Skype ID has been&nbsp;added to your profile.</p>\r\n<p class=\"p1\">Best regards,<br /> CompleteRMP&nbsp;Team.</p>',1,NULL,NULL,NULL,NULL,'2015-05-21 19:00:59','2015-05-21 19:00:59'),(11,1,202,'Review applicant #APP150034','Please can you give us a decision asap on applicant APP150034.\nThanks',1,'2015-05-25 17:00:00',NULL,NULL,NULL,'2015-05-23 03:51:20','2015-05-23 03:51:20'),(12,1,202,'Review Audio for #APP150394','We have resubmitted applicant APP150394, Please can you listen to the audio interview. Thanks ',1,'2015-05-27 12:00:00',NULL,NULL,NULL,'2015-05-23 03:54:27','2015-05-23 03:54:27'),(13,1,205,'Missing Documents for APP150392','Please can you upload the documents for applicant #APP150392.',1,'2015-05-28 12:00:00',NULL,NULL,NULL,'2015-05-25 23:45:22','2015-05-25 23:45:22'),(14,1,205,'Interview Evaluation for APP150235','Please can you submit the evaluation for applicant APP150235. Thanks',1,'2015-05-27 17:00:00',NULL,NULL,NULL,'2015-05-25 23:46:26','2015-05-25 23:46:26'),(15,NULL,208,'Welcome and thanks for registering','<p>Thank you for registering with QEHC. We are pleased to begin the application process with you. As your application progresses, you will be updated via this portal.</p>\r\n<p>You now need to complete your profile. Please fill in the sections as requested. After each section, click the update button to save your details. You can go back and amend or add details to each section.&nbsp;</p>',1,NULL,NULL,NULL,NULL,'2015-06-17 00:17:27','2015-06-17 00:17:27');
