INSERT INTO `discussions` VALUES (17,NULL,'new flight is more suitable, thanks',40,40,16,'en','2015-01-25 09:35:30','2015-01-25 09:35:30'),(16,'Reject Flight Reservation','not suitable sorry',40,40,NULL,'en','2015-01-25 09:33:22','2015-01-25 09:33:22'),(15,NULL,'We are really sorry about this, we\'ll try and rectify the situation soon.',38,7,13,'en','2015-01-23 23:14:46','2015-01-23 23:14:46'),(14,NULL,'We are really sorry about this, we\'ll try and rectify the situation soon.',38,38,13,'en','2015-01-23 23:14:20','2015-01-23 23:14:20'),(13,'Reject Flight Reservation','sorry i asked for a direct flight only and you have given me 3 stops',38,38,NULL,'en','2015-01-23 22:34:56','2015-01-23 22:34:56'),(18,'Housing','wrerwerwerwe',38,7,NULL,'en','2015-01-26 15:58:20','2015-01-26 15:58:20'),(19,'Housing','werwer',38,7,NULL,'en','2015-01-26 15:58:32','2015-01-26 15:58:32'),(20,'Housing','aeqwe',40,7,NULL,'en','2015-01-26 16:00:25','2015-01-26 16:00:25'),(21,'Housing','sdfsdf',3,1,NULL,'en','2015-02-11 20:46:35','2015-02-11 20:46:35'),(22,'Flights','Flights',3,1,NULL,'en','2015-02-11 20:46:57','2015-02-11 20:46:57'),(23,'Test','comment',3,3,NULL,'en','2015-02-12 07:37:41','2015-02-12 07:37:41'),(27,'Housing Allowance','Hi, both my wife and I are interested in working for you, Would we both be entitled to separate housing allowance and transportation allowance? Thanks',135,135,NULL,'en','2015-05-06 09:03:25','2015-05-06 09:03:25'),(28,NULL,'Hi John, unfortunately as you are a couple we can either provide you with suitable accommodation or alternatively we can give you a combined couples allowance. With regards to transportation allowance, as you will both be working in different locations you will both be entitled to receive the allowance.\r\n\r\nPlease let me know if you have any further questions.',135,1,27,'en','2015-05-06 09:06:47','2015-05-06 09:06:47'),(29,NULL,'Thanks, please can you tell me approximately how much the allowance is and what type of accommodation we could get for that price as we have 4 children. thanks',135,135,27,'en','2015-05-06 09:08:15','2015-05-06 09:08:15'),(30,'Contract - Accommodation','Hi I have read the contract and would like some clarification on a few points.<br>1. Accommodation - If both my wife and I are hired will we both be entitled to receive the allowance.<br>2. Transportation allowance - &nbsp;can my wife opt to receive the allowance rather than use the transportation provided.<br>Thanks.',5,5,NULL,'en','2015-05-20 02:24:20','2015-05-20 02:24:20'),(31,NULL,'Hi Andrew, with regards to the accommodation you would receive the couple allowance which is 1.5 times the allocated amount. As for the transportation your wife is entitled to arrange her own transportation.\r\nPlease let us know if you have any further questions.',5,1,30,'en','2015-05-20 02:27:17','2015-05-20 02:27:17'),(32,NULL,'test',3,1,23,'en','2015-06-22 01:47:11','2015-06-22 01:47:11');
