INSERT INTO `email_messages` VALUES (1,'<p class=\"p1\">Dear {applicant_name},<br /> Thank you for registering in QEHC Recruitment Portal. We will use this portal to keep you updated about your application and for all other communication.&nbsp;</p>\r\n<p class=\"p1\">To log in, please go to qehc.edu.sa/rmp/applicant-login using<br /> Email: {email} &nbsp;and &nbsp;Password: {password}<br /> and check your &ldquo;My Tasks&rdquo; link to follow up on your application process.&nbsp;<br /> <br /> Best regards,<br /> {company_name} Team.</p>','<div class=\"email-content\">\r\n<p>Dear {applicant_name},</p>\r\n<p>Please log-in to your account and update your profile as soon as posiible. Please ensure that you CV and certifcates have been uploaded.</p>\r\n</div>\r\n<div class=\"email-content\">\r\n<p>Best regards,<br />{company_name}&nbsp;Team.</p>\r\n</div>','<p class=\"p1\">Dear {applicant_name},</p>\r\n<p>You have been shortlisted for an interview for one of our projects. We kindly request you to schedule a Skype&nbsp;interview appointment at a time convenient for you.&nbsp;</p>\r\n<p>Please log in to your account, click the &ldquo;Schedule Interview&rdquo; link in the left hand menu and complete the form. Please also ensure that your Skype ID has been&nbsp;added to your profile.</p>\r\n<p class=\"p1\">Best regards,<br /> {company_name}&nbsp;Team.</p>','<p class=\"p1\">Dear {applicant_name},</p>\r\n<p>Please note that your Skype interview has been booked for: {appointment_information}.&nbsp;(KSA Time).</p>\r\n<p>Please accept the contact request from QEHC.</p>\r\n<p><span style=\"line-height: 1.6em;\">If you are unable to make this appointment please log in to your account and cancel it, then reschedule an interview time that is more convenient</span></p>\r\n<p class=\"p1\">Best regards,<br /> {company_name}&nbsp;Team.</p>','<p>Dear {applicant_name},</p>\r\n<p>Please note that a {company_name}&nbsp;account has been created for you.&nbsp;</p>\r\n<p>To log into your account please go to&nbsp;qehc.edu.sa/rmp/applicant-login&nbsp;and log in with the details below.</p>\r\n<p>Email: {email}<br />Password: {password}</p>\r\n<p>We will proceed with your application once you have uploaded your degree certificate (and TEFL qualification for ESL positions).</p>\r\n<p>Best regards,<br />{company_name}&nbsp;Team.</p>','<p class=\"p1\">Dear {applicant_name},</p>\r\n<p class=\"p1\">Your visa process is now complete.&nbsp;You are one step closer to deployment.&nbsp;</p>\r\n<p class=\"p1\">Please log in to your account, click &ldquo;Application Status&rdquo; and then &ldquo;Flight Availability&rdquo;. Once you have updated your availability, we will book your flight.</p>\r\n<p class=\"p1\">Best regards,<br /> {company_name}&nbsp;Team.</p>','<p class=\"p1\">Dear {employee_name},</p>\r\n<p class=\"p1\">Please note that an {company_name}&nbsp;account has been created for you.<br /> To login to your account please go to <ins>qehc.edu.sa/rmp/staff</ins>&nbsp;and login with the details below.</p>\r\n<p class=\"p1\">Email: {email}<br /> Password: {password}</p>\r\n<p class=\"p1\">Best regards,<br /> {company_name}&nbsp;Team.</p>','<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Dear {applicant_name},</span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">You are now ready to begin the visa process!&nbsp; Please log in to your account to view the details for your visa agent. You need to check all requirements with the agent and ensure these are met so that your visa can be issued.</span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Best regards,<br /> {company_name}&nbsp;Team</span></p>','<p>Dear {applicant_name},</p>\r\n<p>We are sorry to inform you that your interview appointment scheduled for:&nbsp;{appointment_date}, has been cancelled.&nbsp;</p>\r\n<p>We apologize for any inconvenience this may cause you.&nbsp;We kindly request that you reschedule another appointment at your earliest opportunity.</p>\r\n<p>Best regards,<br /> {company_name}&nbsp;Team.</p>','<p>Dear {applicant_name},</p>\r\n<p style=\"line-height: 15.6pt;\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\">We would like to thank you for interviewing with us for the position of {position}. We are pleased to inform you that your interview was successful and we are awaiting final approval from the client..</span></p>\r\n<p><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Please feel free to visit the FAQs section on the portal should you have any queries about the position in the meantime</span></p>\r\n<p>Best regards,<br /> {company_name} Team</p>','<p class=\"p1\">Dear {applicant_name},</p>\r\n<p style=\"line-height: 15.6pt;\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\">We regret to inform you that your interview did not indicate your suitability for the position under consideration. At this time, there is no other suitable position available.</span></p>\r\n<p style=\"line-height: 15.6pt;\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\">We want to thank you for taking the time to interview with us and we wish you success in your future endeavors.</span></p>\r\n<p class=\"p1\">Best regards,<br /> {company_name}&nbsp;Team.</p>','<p>Dear {applicant_name},</p>\r\n<p style=\"line-height: 15.6pt;\"><span style=\"font-size: 10.0pt; font-family: \'Arial\',\'sans-serif\'; color: #333333;\">Congratulations for reaching this stage in the recruitment process.&nbsp;We are pleased to send you a job offer. Please log in to your account to view the offer.&nbsp;We kindly ask for your response within 3 days. Note that this offer is not binding at this stage and does not guarantee that a contract will be drawn up.</span></p>\r\n<p style=\"line-height: 15.6pt;\"><span style=\"font-size: 10.0pt; font-family: \'Arial\',\'sans-serif\'; color: #333333;\">The package includes accommodation and transportation to/from work as well as medical insurance and one round trip flight. If you wish to make your own arrangements for accommodation and/or travel, an allowance will be added to your offer.</span></p>\r\n<p style=\"line-height: 15.6pt;\">&nbsp;</p>\r\n<p style=\"line-height: 15.6pt;\"><span style=\"font-size: 10.0pt; font-family: \'Arial\',\'sans-serif\'; color: #333333;\">Upon your acceptance, please upload a scanned copy of your signed offer.</span></p>\r\n<p>Best regards,</p>\r\n<p>{company_name} Team</p>','<p class=\"p1\">Dear {applicant_name},</p>\r\n<p style=\"line-height: 15.6pt;\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Your flight has now been booked.&nbsp;Please log in to your account and click &ldquo;Application Status&rdquo; to get the details of your flight. A representative from the company will pick you up at King Khalid Airport. Should you have any emergency before or after your flight, please contact the PR officer as shown on your application.</span></p>\r\n<p class=\"p1\">Best regards,<br /> {company_name}&nbsp;Team.</p>','<p>Dear {name},</p>\r\n<p><span style=\"font-size: 9.5pt; font-family: \'Arial\',\'sans-serif\';\">Please note that an applicant,&nbsp;</span><span style=\"font-size: 10.0pt; font-family: \'Arial\',\'sans-serif\'; color: #333333;\">{applicant_name}</span><span style=\"font-size: 9.5pt; font-family: \'Arial\',\'sans-serif\';\">, has been submitted for review.&nbsp;Could you please log in to your account as soon as possible to complete&nbsp;the review and give us your feedback?</span></p>\r\n<p><span style=\"font-size: 9.5pt; font-family: \'Arial\',\'sans-serif\';\">Contact the Project Manager regarding any queries about the applicant.</span></p>\r\n<p><span style=\"font-size: 9.5pt; font-family: \'Arial\',\'sans-serif\';\">We look forward to hearing from you soon.</span></p>\r\n<p>Best regards,<br /> {company_name}&nbsp;Team.</p>','<p style=\"text-align: left;\">Dear {applicant_name},</p>\r\n<p style=\"text-align: left;\">Your interview scheduled for: {old_appointment} has been changed to: {new_appointment}.&nbsp;(KSA Time).</p>\r\n<p style=\"text-align: left;\"><span style=\"line-height: 1.6em;\">If this time is not convenient please log in and cancel your appointment and reschedule for a time more appropriate.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"line-height: 1.6em;\">We apologize for any inconvenience.</span></p>\r\n<p style=\"text-align: left;\">Best regards,<br /> {company_name}&nbsp;Team.</p>','<p>Dear {applicant_name},</p>\r\n<p><span style=\"font-size: 8.5pt; font-family: \'Verdana\',\'sans-serif\'; color: black;\">We are pleased to inform you that we can offer you a position with QEHC. Please log in to your account to review and respond to the offer. The validity of this offer is for two (2) days only.&nbsp;</span></p>\r\n<p><span style=\"font-size: 8.5pt; font-family: \'Verdana\',\'sans-serif\'; color: black;\">Ensure that your passport details have been entered on your profile and that you have uploaded your passport information page. Once we have received your accepted offer and your profile is complete, we will be able to generate a contract for you.</span></p>\r\n<p>Best regards,</p>\r\n<p>{company_name} Team.</p>','<p>Dear {applicant_name},</p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">We are delighted that you have accepted our offer and your contract is now available for you to sign within the next three days.&nbsp;</span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Access your contract by clicking My Documents and&nbsp;accept it by clicking \"Agree and accept\" then \"Send contract decision\" (the green button).&nbsp;</span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Please print and sign each page, then upload to the portal in the signed contract field. (Depending on your scanner, you may have to submit each page separately: if so, please ensure you name each page appropriately.)</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Further information on the visa process will be sent to you soon. This will appear as a new task on your profile.</span></p>\r\n<p>Best regards,</p>\r\n<p>{company_name} Team</p>','<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Dear {visa_agent},</span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">We have sent your details to our applicant, {applicant_name}. Please log in to your account on&nbsp;<a href=\"../../\" target=\"_blank\">qehc.edu.sa/rmp</a>&nbsp;to access the details and start the visa application process&nbsp;as soon as&nbsp;possible. All necessary documents will be&nbsp;uploaded to&nbsp;{applicant_name}\'s file.&nbsp;</span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">You can contact us at&nbsp;<a href=\"mailto:qehcrecruiters@qehc.edu.sa\" target=\"_blank\">visa@qehc.edu.sa</a></span></p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">Best regards,</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 8pt; font-family: Verdana, sans-serif;\">{company_name} Team</span></p>','<p>Dear {applicant_name},</p>\r\n<p><span style=\"font-size: 8.0pt; font-family: \'Verdana\',\'sans-serif\'; color: black;\">An entry has been made in your profile under&nbsp;{discussion_topic}. Please log in at your earliest convenience to read and respond to this entry under the Discussions tab.&nbsp;</span>&nbsp;</p>\r\n<p>Best regards,<br />{company_name}&nbsp;Team.</p>','<p class=\"p1\">Dear {applicant_name},</p>\r\n<p>Your flight has now been booked.&nbsp;Please log in to your account and click &ldquo;Application Status&rdquo; to get the details of your flight. A representative from the company will pick you up at King Khalid Airport. Should you have any emergency before or after your flight, please contact the PR officer as shown on your application.</p>\r\n<p class=\"p1\">Best regards,<br />{company_name}&nbsp;Team.</p>','<div class=\"email-content\">\r\n<p>Dear {applicant_name},</p>\r\nThank you for you application for: {advert_title}.</div>\r\n<div class=\"email-content\">We will review your application and one of our representative will contact you shortly.<br />\r\n<p>Best regards,<br />{company_name}&nbsp;Team.</p>\r\n</div>','<p dir=\"rtl\">عزيزتي {applicant_name}،</p>\r\n<p dir=\"rtl\">كنت قد المختصرة لمقابلة لأحد مشاريعنا. نحن نطلب منكم لجدولة موعد للمقابلة سكايب في وقت مناسب بالنسبة لك {email}, {password}.</p>\r\n<p dir=\"rtl\">يرجى تسجيل الدخول إلى حسابك، انقر على رابط \"جدول مقابلة\" في القائمة اليسرى واستكمال النموذج. يرجى أيضا التأكد من أن معرف سكايب الخاص بك قد أضيفت إلى ملف التعريف الخاص بك.</p>\r\n<p dir=\"rtl\">مع أطيب التحيات، <br />{company_name} فريق.</p>',NULL,'<p dir=\"rtl\">عزيزتي {applicant_name}،</p>\r\n<p dir=\"rtl\">كنت قد المختصرة لمقابلة لأحد مشاريعنا. نحن نطلب منكم لجدولة موعد للمقابلة سكايب في وقت مناسب بالنسبة لك.</p>\r\n<p dir=\"rtl\">يرجى تسجيل الدخول إلى حسابك، انقر على رابط \"جدول مقابلة\" في القائمة اليسرى واستكمال النموذج. يرجى أيضا التأكد من أن معرف سكايب الخاص بك قد أضيفت إلى ملف التعريف الخاص بك.</p>\r\n<p dir=\"rtl\">مع أطيب التحيات، <br />{company_name} فريق.</p>','<p dir=\"rtl\">{applicant_name}, {appointment_information},{company_name}</p>','<p dir=\"rtl\">{applicant_name}, {email}, {password},</p>','<p dir=\"rtl\">{applicant_name}, {company_name},</p>','<p dir=\"rtl\">{employee_name}, {email}, {password},</p>','<p dir=\"rtl\">عزيزتي {applicant_name}،</p>\r\n<p dir=\"rtl\">أنت الآن على استعداد لبدء عملية تأشيرة! يرجى تسجيل الدخول إلى الحساب الخاص بك لعرض تفاصيل عن وكيل الحصول على التأشيرة. تحتاج إلى التحقق من كافة المتطلبات مع وكيل وضمان استيفاء هذه بحيث يمكن إصدار التأشيرة.</p>\r\n<p dir=\"rtl\">مع أطيب التحيات،</p>\r\n<p dir=\"rtl\">{company_name} فريق.</p>',NULL,'<p dir=\"rtl\">{applicant_name}, {position},</p>','<p dir=\"rtl\">{applicant_name}, {company_name},</p>','الوظائف الإدارية - أبها','<p dir=\"rtl\">{applicant_name}, {company_name},</p>','<p dir=\"rtl\">{name}, {applicant_name},</p>','<p dir=\"rtl\">{applicant_name}, {old_appointment}, {new_appointment},</p>','<p dir=\"rtl\">عزيزتي {applicant_name}،</p>\r\n<p dir=\"rtl\">يسرنا أن نعلمكم بأننا يمكن أن نقدم لكم موقف مع QEHC. يرجى تسجيل الدخول إلى حسابك للمراجعة والرد على العرض. صحة هذا العرض لمدة سنتين (2) أيام فقط.</p>\r\n<p dir=\"rtl\">التأكد من أن تفاصيل جواز سفرك قد دخلت في ملفك الشخصي والتي قمت بتحميلها صفحة معلومات جواز السفر الخاص بك. بمجرد تلقينا قبلت عرضك والتعريف الخاص بك هو الكامل، ونحن سوف تكون قادرة على توليد العقد بالنسبة لك.</p>\r\n<p dir=\"rtl\">مع أطيب التحيات،</p>\r\n<p dir=\"rtl\">{company_name} فريق.</p>','<p dir=\"rtl\">{applicant_name}, {company_name},</p>',NULL,'<p dir=\"rtl\">{applicant_name}, {discussion_topic},</p>','<p dir=\"rtl\">{applicant_name}, {company_name},</p>',NULL,'2014-06-02 20:00:28','2015-03-18 07:16:20');
