INSERT INTO `evaluation_options` VALUES (1,'<p>Personality, Manner, Attitude, and Impression <br /> Does the applicant make a good impression?</p>',4,'<p>1 - POOR: Does not project a good attitude nor make a good impression.</p>\r\n<p>2- ACCEPTABLE: Projects a good attitude and impression.</p>\r\n<p>3- VERY GOOD: Projects a warm, open, and accepting attitude and makes a very good impression.</p>\r\n<p>4- OUTSTANDING: Has charisma, seems to attract others.</p>','8,12,14,28,29',3,1,'en',NULL,2015),(2,'The extent to which the candidate has acquired skills and qualifications through past ESL/international work experience.',3,'<p>1 &ndash; 1-2 yrs or / (1-3 years of non-ESL teaching) add +1for regional exp.<br />\r\n2 &ndash; 3-4 yrs / (4-6+ years of non-ESL teaching)<br />\r\n3 &ndash; 5+ yrs / (7+ years of non-ESL teaching)</p>\r\n','1,2,3,',2,1,'en',NULL,2014),(3,'The extent to which the candidate is able to identify key instructional elements in the teaching process according to institutional standards.',2,'<p>1 &ndash; Shows little to no awareness of required approaches&nbsp;<br />\r\n<span style=\"line-height: 1.6em;\">2 &ndash; Shows basic awareness of required approaches<br />\r\n3 &ndash; Shows excellent awareness of required approaches</span></p>\r\n','1,3,',1,1,'en',NULL,2014),(4,'<p>Human Relations<br />How effective will the applicant be in working with others?</p>',4,'<p>1 - POOR: Seems unable to relate to others.</p>\r\n<p>2- ACCEPTABLE: Indicates some ability to work with others.</p>\r\n<p>3- VERY GOOD: indicates significant ability to understand others with different viewpoints.</p>\r\n<p>4- OUTSTANDING: Indicates outstanding interpersonal relationship ability and perception.</p>','8,27,28,29,30',3,1,'en',NULL,2015),(5,'The extent to which the applicant displays a native level of clarity of speech, expression, quickness in understanding and delivery using both verbals and nonverbals.  ',3,'<p>1 &ndash; Beginner level, significant mistakes, poor accent<br />\r\n2 &ndash; Intermediate, mistakes are present<br />\r\n3 &ndash; Native level communication, able to fully access English language</p>\r\n','',1,1,'en',NULL,2014),(6,'The extent to which the applicant appears to have a true desire and ability to inspire learning in students and demonstrate a high degree of initiative.',3,'<p>1 &ndash; Little to no interest/passion for engaging students<br />\r\n2 &ndash; Moderate interest/passion for engaging students<br />\r\n3 &ndash; Significant interest/passion for engaging students</p>\r\n','',3,1,'en',NULL,2014),(7,'The extent to which the applicant’s presence, professional appearance, confidence level, maturity and overall personal goals align with QEHC’s mission.',3,'<p>1 &ndash; Possesses 1or 2 traits of:<br />\r\npresence, professional appearance, confidence, maturity, personal goals align with QEHC mission<br />\r\n2 &ndash; 3 or 4 traits present<br />\r\n3 &ndash; 5 traits present</p>\r\n','1,2,3,4,',2,1,'en',NULL,2014),(8,'Computer scientist -(for SEU)- teach & develop new technologies, systems and computer-based solutions.',10,'<p><span style=\"background-color:Lime;\">1-<strong>(+1)</strong> hold a bachelor&#39;s degree or above with a major in computer science, information systems or software engineering (on campus education)<strong>(-10)</strong>.</span></p>\r\n\r\n<p><span style=\"background-color:Yellow;\">2-<strong>(+1) </strong>any&nbsp;coursework in hardware and software systems, program languages, computational modeling, research project<strong>(+0)</strong>.</span></p>\r\n\r\n<p><span style=\"background-color:Lime;\">3-<strong>(+1)</strong>&nbsp;more than three years experience with at least one year teaching or training<strong>(-10)</strong>.</span></p>\r\n\r\n<p><span style=\"background-color:Yellow;\">4-<strong>(+1)</strong> Single<strong>(+0)</strong>.</span></p>\r\n\r\n<p><span style=\"background-color:Yellow;\">5-<strong>(+1) </strong>can join on due date, no notice period need<strong>(+0)</strong>.</span></p>\r\n\r\n<p><span style=\"background-color:Yellow;\">6-<strong>(+1)</strong> GCC experience<strong>(+0)</strong>.</span></p>\r\n\r\n<p><span style=\"background-color:Yellow;\">7-<strong>(+1)</strong>&nbsp;programing creation<strong>(+0)</strong>.</span></p>\r\n\r\n<p><span style=\"background-color:Yellow;\">8-<strong>(+1)</strong> PMP<strong>(+0)</strong>.</span></p>\r\n\r\n<p><span style=\"background-color:Yellow;\">9-<strong>(+1)</strong> has&nbsp;recommendations<strong>(+0)</strong>.</span></p>\r\n\r\n<p><span style=\"background-color:Lime;\">10-<strong>(+1)</strong>&nbsp;has no ban from traveling to KSA <strong>or</strong> can transfer the Iqama for candidates inside KSA<strong>(-10)</strong>.</span></p>\r\n','9',1,1,'en','2014-06-16 15:45:54',2014),(10,'Educational Background:  The extent to which the candidate has relevant educational qualifications or training for this position.',3,'<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">A: Certificate and/or Diploma (2 year ESL/TESOL)</div>\r\n\r\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">B: BA</div>\r\n\r\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">C: MA or higher</div>\r\n','18',3,1,'en','2014-06-30 11:05:49',2014),(11,'<p>Motivation<br />Is the applicant a self-starter?</p>',4,'<p>1 - POOR: Not a self-starter. Not able to motivate others.</p>\r\n<p>2- ACCEPTABLE: Some ability to work without supervision and motivate others.</p>\r\n<p>3- VERY GOOD: Significant ability to work without supervision and motivate others.</p>\r\n<p>4- OUTSTANDING: Superior ability to work without supervision and motivate others.</p>','8,12,28,29',3,1,'en','2014-06-30 11:08:58',2015),(12,'Project Requirements: 	The extent to which the candidate is able to identify key instructional elements in the teaching process according to institutional standards.',3,'<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">A: Shows little to no awareness of required approaches</div>\r\n\r\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">B: Shows basic awareness of required approaches</div>\r\n\r\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">C: Shows excellent awareness of required approaches</div>\r\n','18',1,1,'en','2014-06-30 13:51:05',2014),(13,'Adaptability:  The extent to which the applicant has been exposed to foreign environments for extended periods of time and demonstrates strong ability to adapt to challenges.',5,'<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">A: 1 &ndash; 2 years in foreign environment&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; add +1 for exp. in Gulf</div>\r\n\r\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">B: 3 &ndash; 4 years in foreign environment&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; add +2 for exp. in KSA</div>\r\n\r\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">C: 5+ years in foreign environment</div>\r\n','18',1,1,'en','2014-06-30 13:51:36',2014),(14,'<p>Experience</p>',4,'<p>1 - POOR: Limited work, volunteer, or organization experience.</p>\r\n<p>2- ACCEPTABLE: Has demonstrated some work, volunteer, or organization experience.</p>\r\n<p>3- VERY GOOD: Has significant work, volunteer, or organization experience.</p>\r\n<p>4- OUTSTANDING: Has superior, work, volunteer, or organization experience.</p>','8,13,27,29',1,1,'en','2014-06-30 13:52:59',2015),(16,'Motivation/Initiative:  The extent to which the applicant appears to have a true desire and ability to inspire learning in students and demonstrate a high degree of initiative.',3,'<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">A:Little to no interest/passion for engaging students</div>\r\n\r\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">B: Moderate interest/passion for engaging students</div>\r\n\r\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">C: Significant interest/passion for engaging students&nbsp;</div>\r\n','18',1,1,'en','2014-06-30 13:53:46',2014),(18,'<p>Decision-making Skills and Judgment<br />How effective will the applicant be in working with others?</p>',4,'<p>1 - POOR: Gives slow hesitant responses, gives unorganized, unacceptable responses.</p>\r\n<p>2- ACCEPTABLE: Responses are somewhat organized and acceptable, but indicates a lack of maturity and good judgment.</p>\r\n<p>3- VERY GOOD: Gives well organized thoughts which lead from judgment and common sense.</p>\r\n<p>4- OUTSTANDING: Exceptional ability to organize thoughts and make decisions, which show evidence of sound judgment and common sense.</p>','8,9,27,28,29',1,1,'en','2014-06-30 13:55:27',2015),(19,'ايستبس سيهب ٣ف؛  ت سني سيب ي نكنبس يب سيب للكسنبكم يلت تيتليبالم',5,'<p dir=\"rtl\"><span style=\"font-size: 12pt;\">نسيتب سيبنيس كسح ثخلس؛سكبس؛يبن يبخليبحل سكمبمينس خيستب</span></p>','22,23',2,1,'sa','2014-10-25 23:28:14',2014),(20,'<p>Overall Impression</p>',4,'<p>1 - POOR: Unimpressive.</p>\r\n<p>2 - ACCEPTABLE: Acceptable Presentation, articulate.</p>\r\n<p>3 - VERY GOOD: Very good presentation, articulate.</p>\r\n<p>4 - OUTSTANDING: Exceptionally clear and impressive.</p>','8,9,10,12,13,14,27,28,29,30,31',3,1,'en','2014-11-13 10:38:43',2015);
