INSERT INTO `job_adverts` VALUES (1,'Riyadh','Junior/Mid Graphic Designer for creative agency',2,'AID151','<p>As a Graphic Designer within the department, you will be working alongside other creatives such as visualisers and 3D designers, therefore an ability to communicate clearly across several design departments is key. You will be happy working in a collaborative and lively environment, which will demand a hardworking approach, and be ready to create new ways to propose new ways in which to present a client pitch in an innovative manner.</p>\r\n<p>&nbsp;</p>\r\n<p>You would be:<br />* Supporting the design team with designing, plan and deliver workspace design and furniture solutions and services individually tailored to each client.<br />* Creating dynamic, modern and compelling collateral including proposal documents and dynamic content such as presentations<br />* Assisting in creating a standard design template, and then tailoring and populating for each opportunity<br />* Designing and produce bespoke special one-off documents and presentations including brochures<br />* CAD work producing space plans<br />* Assisting with creating product documentation, spec and images<br />* Assisting with creating client pitch and presentation documents.<br />* Liaising with Project Co-ordinators, Account Managers &amp; installations team.</p>','<p>Integrated commercial interior specialist based in London are seeking an accomplished and dedicated Graphic Designer with a hands on approach to join their design team.<br /><br /></p>',1,20,29,1,'<p>&pound;22,000 to 28,000 p/a &nbsp;</p>\r\n<p>Position: Perminent &nbsp;</p>','<p>You must:<br /><br />* Be extremely fluent in all relevant Adobe design software (InDesign, Illustrator, Photoshop and Acrobat)<br />* Have good knowledge of CAD, Sketch Up, 3D Max<br />* Have good knowledge of Microsoft Office Suite<br />* Be fully comfortable with designing for print with a good knowledge of production techniques and options<br />* Previous experience working within an interior design or similar business would be desirable.</p>','','2015-04-01','2015-05-18 00:00:00',2,'<p>d fsdfsdfsdf sdf sd</p>',3,NULL,2,2,2,NULL,NULL,NULL,2,3,1,1,'en',1,58,'Micah Angus','Micah Angus','2015-01-22 16:34:36','2016-02-06 14:19:18'),(2,'Riyadh','Paediatric Surgeon Required for Hospital',4,'AID152','<p>Paediatric Surgeon Required for Hospital</p>','<p>Paediatric Surgeon Required for Hospital</p>',5,21,27,1,'<p>Paediatric Surgeon Required for Hospital</p>','<p>Paediatric Surgeon Required for Hospital</p>','<p>Paediatric Surgeon Required for Hospital</p>','2015-08-11','2015-01-22 00:00:00',1,'<p>All nationalities considered for this position</p>',3,NULL,1,NULL,2,NULL,NULL,NULL,5,1,1,2,'en',2,20,'Micah Angus','Jonathan Jones','2015-01-22 18:21:34','2015-05-19 23:33:28'),(3,'Riyadh','Energetic sales reps required for marketing agency',35,'AID153','<p>Will leaise with clients and&nbsp;give presentations to demonstrate the software caperbilities.&nbsp;</p>','<p>We require 7 sales representative for a multi media agency. Earn attractive commisions on&nbsp;sales of their IT product range</p>',1,22,31,1,'<p>Paediatric Surgeon Required for Hospital</p>','<p>Paediatric Surgeon Required for Hospital</p>','<p>Paediatric Surgeon Required for Hospital</p>','2015-01-23','2015-01-22 00:00:00',1,'',1,NULL,1,NULL,2,NULL,NULL,NULL,5,3,1,1,'en',2,32,'Micah Angus','Micah Angus','2015-02-10 19:15:13','2016-02-10 23:38:54'),(6,NULL,'Digital Designer',2,'AID156','<p>The junior designer must have a proven track record in creating effective and relevant designs for a range of digital solutions and applications. They should relish the challenge of the growing<br /><br />multi-plat formed, digital landscape. And finally, they should understand and be able to extend the visual language for any given client, taking into consideration not only how it looks, but how it will be interacted with and how it will work.</p>','<p>The central London based agency is a full service social and digital marketing agency. Their work addresses a very wide range of business and brand challenges. They combine an unusually experienced strategy team with a highly innovative creative function, but always driven by a long-term strategic view of how social/digital platforms, channels and technology can build brands over time.</p>',1,20,29,2,'<p>&pound;22,000 p/a &nbsp;&nbsp;</p>','<p>* 1+ years of web experience and/or formal design training.<br />* You should have a strong portfolio relevant to your experience with diverse and engaging design examples.<br />* You should have a very strong portfolio relevant to your experience with diverse and engaging design examples.<br />* You should be proficient in Mac OS X, Illustrator, Photoshop &amp; Google software.<br />* You should show an active \'love\' and motivation for anything design-related. Passion should be one of your key drivers.<br />* You should show an active \'love\' and motivation for anything design-related. Passion should be one of your key drivers.<br />* Want to continuously learn new skills and proactively build upon your current set.</p>','','2015-04-01','2015-01-22 00:00:00',2,'',1,NULL,2,2,2,NULL,NULL,NULL,2,3,1,1,'en',1,1,'Micah Angus',NULL,'2015-05-18 12:06:47','2015-05-18 12:18:47'),(7,NULL,'Teachers for Prime Schools',2,'AID157','<p>ADEC schools are located throughout the Emirate of Abu Dhabi. This includes the cosmopolitan island city of Abu Dhabi, which is situated just off the mainland of the UAE and the vast coastline of the Arabian Gulf; the oasis &ldquo;Garden City&rdquo; of Al Ain, right on the Oman border and a short drive to both Abu Dhabi city and Dubai; and Al Gharbia, which offers a peaceful desert atmosphere and the most culturally immersive environment. Throughout the Emirate one can expect a year-round hot and almost perpetually sunny environment.</p>\r\n<p>ADEC Science teaching jobs are for motivated and experienced educators who can assist with the country&rsquo;s educational reform initiative. Through this initiative, the country aims to ready its youth at all levels, from primary to college, for international success.</p>\r\n<p>These contracts with lucrative benefits are open only to those holding full teacher licensure/certification.&nbsp;All ADEC Science teaching applicants must be native English speakers, and able&nbsp;to attend an in-person interview in North America, the UK, Ireland, South Africa, Abu Dhabi, Australia, or New Zealand.</p>','<p><strong>Teach in Saudi&nbsp;public schools.</strong>&nbsp;We are accepting applications for Grades 6 - 8 teaching jobs with the Saudi Education Council (SEC). We are currently looking for Science, Maths and English teachers. Immediate start!!</p>',6,23,14,1,'<p><label>Accommodation:</label>Provided <br /><label>Accommodation Details:</label>Accommodation provided for teacher and dependents <br /><label>Airfare Reimbursement:</label>Full <br /><label>Airfare Description:</label>Annual round-trip airfare provided for teacher and dependents <br /><label>Vacation:</label>Mid-July to mid-August; all national holidays <br /><label>Bonus:</label>End of contract bonus (1 month salary per year) <br /><label>Airport Pickup:</label>Provided <br /><label>Health Insurance Provided:</label>Yes</p>','<p><label><strong>Required Certificates</strong>:</label>Teaching Credential/License <br /><label><strong>Teaching Experience</strong>:</label>2 years of middle school Science teaching experience <br /><br /></p>','<p><label>Additional Requirements:</label>Teaching certification must be in middle school Science; Native English speaker; Able to attend an in-person interview in North America, the UK, Ireland, South Africa, Abu Dhabi, Australia, or New Zealand</p>','2015-09-01','2015-05-18 00:00:00',2,'',1,NULL,2,1,2,NULL,NULL,NULL,2,3,1,1,'en',1,52,'Micah Angus','Jonathan Jones','2015-05-18 19:32:26','2016-01-18 05:01:40'),(8,NULL,'EFL Teachers required for prestigious university',2,'AID158','<p>ADEC schools are located throughout the Emirate of Abu Dhabi. This includes the cosmopolitan island city of Abu Dhabi, which is situated just off the mainland of the UAE and the vast coastline of the Arabian Gulf; the oasis &ldquo;Garden City&rdquo; of Al Ain, right on the Oman border and a short drive to both Abu Dhabi city and Dubai; and Al Gharbia, which offers a peaceful desert atmosphere and the most culturally immersive environment. Throughout the Emirate one can expect a year-round hot and almost perpetually sunny environment.</p>\r\n<p>ADEC Science teaching jobs are for motivated and experienced educators who can assist with the country&rsquo;s educational reform initiative. Through this initiative, the country aims to ready its youth at all levels, from primary to college, for international success.</p>\r\n<p>These contracts with lucrative benefits are open only to those holding full teacher licensure/certification.&nbsp;All ADEC Science teaching applicants must be native English speakers, and able&nbsp;to attend an in-person interview in North America, the UK, Ireland, South Africa, Abu Dhabi, Australia, or New Zealand.</p>','<p>EFL teachers required to teach at one of KSA most prestigious universites. We are seeking&nbsp;eceptional male and females teachers who are ecited about experiencing new cultures and opportunites.</p>',7,24,8,1,'<p><label>Accommodation:</label>Provided <br /><label>Accommodation Details:</label>Accommodation provided for teacher and dependents <br /><label>Airfare Reimbursement:</label>Full <br /><label>Airfare Description:</label>Annual round-trip airfare provided for teacher and dependents <br /><label>Vacation:</label>Mid-July to mid-August; all national holidays <br /><label>Bonus:</label>End of contract bonus (1 month salary per year) <br /><label>Airport Pickup:</label>Provided <br /><label>Health Insurance Provided:</label>Yes</p>','<p><label><strong>Required Certificates</strong>:CELTA / 120 HOUR TEFL</label><br /><br /></p>','<p><label>Additional Requirements:</label>Teaching certification must be in middle school Science; Native English speaker; Able to attend an in-person interview in North America, the UK, Ireland, South Africa, Abu Dhabi, Australia, or New Zealand</p>','2015-09-01','2015-05-18 00:00:00',2,'',1,NULL,2,1,2,NULL,NULL,NULL,3,3,1,1,'en',1,8,'Jonathan Jones',NULL,'2015-05-18 23:10:55','2016-02-05 16:40:38'),(9,NULL,'Ward Manager',4,'AID159','<p>This fully compliant, modern hospital complex provides essential care for Women and Adolescents with mental health needs. The hospital has several departments, including low secure wards, locked rehabilitation services and a Psychiatric Intensive Care Unit. We are looking for a talented RMN or RNLD with proven leadership experience to work as Ward Manager in providing support to the Clinical Services Manager and ensuring the delivery of effective care and treatment aswell as the following responsibilities:</p>\r\n<ul>\r\n<li>Managing day to day clinical and professionals issues in designated clinical areas</li>\r\n<li>Providing leadership, direction, support and supervision for the nursing team in accordance with compliance and operational objectives</li>\r\n<li>Being accountable for the delivery of weekly reports, audits, staffing resources, developing skills and ensuring systems are in place for all staff and patients</li>\r\n</ul>','<p>Are you a qualified RMN or RNLD? Do you have experience of leading a team in a mental health environment? Are you looking to take the next step in your career? If so, we have a fantastic career-defining opportunity for a nurse to take on the role of Ward Manager in a mental health hospital located just outside of Sheffield City Centre.</p>',5,21,27,1,'<p>The hours for the post of Ward Manager are Monday to Friday, 9am until 5pm, although some flexibility may be required on occasion. The type of nurse we are looking for is someone who is resilient, flexible, calm and adaptable to change. Whether you are an RMN or RNLD you will be developed by your line managers and given a platform for progression and personal development while working hard to improve the lives of those in your care. This is a company that will be there to support you in all areas, whether it is on the floor and in creating your future in leadership. Once you commence employment as a Ward Manager, you will also receive the following benefits:</p>\r\n<ul>\r\n<li>An annual salary between &pound;40,000 - &pound;42,000 dependent on experience</li>\r\n<li>Training and support with unrivalled progression opportunities</li>\r\n<li>Generous company pension scheme</li>\r\n<li>A company sick pay scheme to provide security for short term ill health</li>\r\n<li>Life insurance (3 x your annual salary)</li>\r\n<li>Income protection scheme in the event of long term ill health or disability</li>\r\n<li>Private healthcare (including dentistry, eye tests, day to day and specialist needs)</li>\r\n<li>Free meals/refreshments for all staff on duty</li>\r\n<li>Childcare vouchers</li>\r\n<li>Cycle to work scheme (and changing facilities for afterwards, including showers)</li>\r\n<li>Free car parking</li>\r\n</ul>','<ul>\r\n<li>Bachelor&rsquo;s Degree in Nursing required.</li>\r\n<li>Current Nurse Licensure from country of origin required.</li>\r\n<li>Six (6) years hospital experience as a registered nurse with two (2) years leadership experience required.</li>\r\n<li>Experience in surgical nursing specialty area is a requirement</li>\r\n</ul>','','2015-08-11','2015-01-22 00:00:00',2,'',1,NULL,1,NULL,2,NULL,NULL,NULL,6,3,1,1,'en',1,0,'Jonathan Jones','Jonathan Jones','2015-05-19 05:47:36','2015-05-19 23:34:27'),(10,NULL,'Secretary and PA',33,'AID1510','<p>ADEC schools are located throughout the Emirate of Abu Dhabi. This includes the cosmopolitan island city of Abu Dhabi, which is situated just off the mainland of the UAE and the vast coastline of the Arabian Gulf; the oasis &ldquo;Garden City&rdquo; of Al Ain, right on the Oman border and a short drive to both Abu Dhabi city and Dubai; and Al Gharbia, which offers a peaceful desert atmosphere and the most culturally immersive environment. Throughout the Emirate one can expect a year-round hot and almost perpetually sunny environment.</p>\r\n<p>ADEC Science teaching jobs are for motivated and experienced educators who can assist with the country&rsquo;s educational reform initiative. Through this initiative, the country aims to ready its youth at all levels, from primary to college, for international success.</p>\r\n<p>These contracts with lucrative benefits are open only to those holding full teacher licensure/certification.&nbsp;All ADEC Science teaching applicants must be native English speakers, and able&nbsp;to attend an in-person interview in North America, the UK, Ireland, South Africa, Abu Dhabi, Australia, or New Zealand.</p>','<p>Admin Assistant</p>',8,25,NULL,1,'<p><label>Accommodation:</label>Provided <br /><label>Accommodation Details:</label>Accommodation provided for teacher and dependents <br /><label>Airfare Reimbursement:</label>Full <br /><label>Airfare Description:</label>Annual round-trip airfare provided for teacher and dependents <br /><label>Vacation:</label>Mid-July to mid-August; all national holidays <br /><label>Bonus:</label>End of contract bonus (1 month salary per year) <br /><label>Airport Pickup:</label>Provided <br /><label>Health Insurance Provided:</label>Yes</p>','<p><label><strong>Required Certificates</strong>:</label>Teaching Credential/License <br /><label><strong>Teaching Experience</strong>:</label>2 years of middle school Science teaching experience <br /><br /></p>','<p><label>Additional Requirements:</label>Teaching certification must be in middle school Science; Native English speaker; Able to attend an in-person interview in North America, the UK, Ireland, South Africa, Abu Dhabi, Australia, or New Zealand</p>','2015-09-01','2015-05-18 00:00:00',2,'',1,NULL,2,NULL,2,NULL,NULL,NULL,2,3,1,1,'en',1,0,'Jonathan Jones','Jonathan Jones','2015-06-08 22:11:09','2015-06-08 22:16:04'),(12,NULL,'ثصقصثقصثقصث',2,'AID1512','<p>As a Graphic Designer within the department, you will be working alongside other creatives such as visualisers and 3D designers, therefore an ability to communicate clearly across several design departments is key. You will be happy working in a collaborative and lively environment, which will demand a hardworking approach, and be ready to create new ways to propose new ways in which to present a client pitch in an innovative manner.</p>\r\n<p>&nbsp;</p>\r\n<p>You would be:<br />* Supporting the design team with designing, plan and deliver workspace design and furniture solutions and services individually tailored to each client.<br />* Creating dynamic, modern and compelling collateral including proposal documents and dynamic content such as presentations<br />* Assisting in creating a standard design template, and then tailoring and populating for each opportunity<br />* Designing and produce bespoke special one-off documents and presentations including brochures<br />* CAD work producing space plans<br />* Assisting with creating product documentation, spec and images<br />* Assisting with creating client pitch and presentation documents.<br />* Liaising with Project Co-ordinators, Account Managers &amp; installations team.</p>','<p>Integrated commercial interior specialist based in London are seeking an accomplished and dedicated Graphic Designer with a hands on approach to join their design team.<br /><br /></p>',8,25,NULL,2,'<p>&pound;22,000 to 28,000 p/a &nbsp;</p>\r\n<p>Position: Perminent &nbsp;</p>','<p>You must:<br /><br />* Be extremely fluent in all relevant Adobe design software (InDesign, Illustrator, Photoshop and Acrobat)<br />* Have good knowledge of CAD, Sketch Up, 3D Max<br />* Have good knowledge of Microsoft Office Suite<br />* Be fully comfortable with designing for print with a good knowledge of production techniques and options<br />* Previous experience working within an interior design or similar business would be desirable.</p>','<p>لابابلابلابلا</p>','2015-04-01','2015-05-18 00:00:00',2,'<p>d fsdfsdfsdf sdf sd</p>',3,NULL,2,2,2,NULL,NULL,NULL,2,3,1,1,'sa',1,1,'Jonathan Jones',NULL,'2015-06-11 05:18:18','2015-06-17 00:18:57'),(13,NULL,'arabic test',2,'AID1513','<p>As a Graphic Designer within the department, you will be working alongside other creatives such as visualisers and 3D designers, therefore an ability to communicate clearly across several design departments is key. You will be happy working in a collaborative and lively environment, which will demand a hardworking approach, and be ready to create new ways to propose new ways in which to present a client pitch in an innovative manner.</p>\r\n<p>&nbsp;</p>\r\n<p>You would be:<br />* Supporting the design team with designing, plan and deliver workspace design and furniture solutions and services individually tailored to each client.<br />* Creating dynamic, modern and compelling collateral including proposal documents and dynamic content such as presentations<br />* Assisting in creating a standard design template, and then tailoring and populating for each opportunity<br />* Designing and produce bespoke special one-off documents and presentations including brochures<br />* CAD work producing space plans<br />* Assisting with creating product documentation, spec and images<br />* Assisting with creating client pitch and presentation documents.<br />* Liaising with Project Co-ordinators, Account Managers &amp; installations team.</p>','<p>Integrated commercial interior specialist based in London are seeking an accomplished and dedicated Graphic Designer with a hands on approach to join their design team.<br /><br /></p>',1,20,NULL,1,'<p>&pound;22,000 to 28,000 p/a &nbsp;</p>\r\n<p>Position: Perminent &nbsp;</p>','<p>You must:<br /><br />* Be extremely fluent in all relevant Adobe design software (InDesign, Illustrator, Photoshop and Acrobat)<br />* Have good knowledge of CAD, Sketch Up, 3D Max<br />* Have good knowledge of Microsoft Office Suite<br />* Be fully comfortable with designing for print with a good knowledge of production techniques and options<br />* Previous experience working within an interior design or similar business would be desirable.</p>','','2015-04-01','2015-05-18 00:00:00',2,'<p>d fsdfsdfsdf sdf sd</p>',3,NULL,2,2,2,NULL,NULL,NULL,2,3,1,1,'sa',1,0,'Jonathan Jones',NULL,'2015-06-16 12:34:56','2015-06-16 12:34:56');
