INSERT INTO `profiles` VALUES (1,1,NULL,NULL,'/uploads/employees/1/wIZc9TJ5/400x400_crop/23.jpg','/uploads/employees/1/wIZc9TJ5/30x30_crop/23.jpg','2015-05-19 09:00:00','2015-05-19 17:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'0555593849',NULL,NULL,'8987','89798',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,'6',NULL,NULL,NULL,NULL,2,1,NULL,NULL,2,NULL,'United States','2014-06-04 18:08:14','2015-05-19 04:22:43','Micah Angus'),(2,2,'<p>At the moment I\'m importing tinker toys in Nigeria. Enthusiastic about working on circus clowns for no pay. In 2009 I was analyzing human hair in Prescott, AZ. Spent several months merchandising tobacco in Prescott, AZ. Managed a small team researching bullwhips in Ocean City, NJ. Spent several years donating squirt guns in Miami, FL.</p>',NULL,'/uploads/applicants/1/1.jpg','/uploads/applicants/1/crop/1.jpg',NULL,NULL,'2',NULL,NULL,NULL,'Social Science Research Assistants','education',NULL,'44','793874622',NULL,'connor.randall','',NULL,'',NULL,'','British','English','1981-07-10','Single','1198 County Road 4107,','Brockley','Granby','HP23 5UW','Afghanistan',NULL,'','',5,'Ethan','Dacre','Manager','Senior Manager',2,2,'+1118 531 6729','+1145 750 7266',NULL,'Soo_hyun.Jang@ex9ample.com','Lalane','Ding-line','Soo_hyun.Jang@ex9ample.com','Jung_hwan.Su@examp2le.com',NULL,0,2,'6',NULL,NULL,NULL,NULL,2,0,NULL,NULL,2,1,'United Kingdom','2015-02-02 17:15:27','2015-05-18 06:15:26','Micah Angus'),(3,3,'<p>Spent 2001-2008 working on wool in Atlantic City, NJ. Spent several years working on Roombas in Las Vegas, NV. Spent high school summers building birdhouses in Minneapolis, MN. Spent 2002-2007 creating marketing channels for circus clowns in West Palm Beach, FL. Spoke at an international conference about licensing weebles in Las Vegas, NV. Prior to my current job I was managing toy soldiers in Ohio.</p>',NULL,'/uploads/applicants/3/2e