INSERT INTO `system_messages` VALUES (1,'<h2 class=\"no-margin-top\">Welcome to CompleteRMP</h2>\r\n<p><span style=\"line-height: 1.6em;\">The&nbsp;portal has been established to streamline&nbsp;our recruitment process and to ensure that our applicants are kept informed at all times.&nbsp;</span></p>\r\n<p>We invite you to create an account in order to access all the opportunities found in our company&rsquo;s projects in Saudi Arabia.</p>','<p>The Recruitment Portal is our prime means of communication with candidates. It is easy to use but, should you have difficulties, you can email us at <a href=\"mailto:recruitment@completermp.com\">recruitment@completermp.com</a>.</p>','<p>This portal is used for our complete application process. After registering with us you will be sent your login details by email. Each time you log in you will be prompted as to the next stage in the process under \"Tasks\" (on the top of your screen).</p>','<p>Your passport number can be used to identify individuals who share the same or similar names.</p>','asdasd','<p>Thank you for registering with QEHC. We are pleased to begin the application process with you. As your application progresses, you will be updated via this portal.</p>\r\n<p>You now need to complete your profile. Please fill in the sections as requested. After each section, click the update button to save your details. You can go back and amend or add details to each section.&nbsp;</p>','<p>There are a number of Frequently Asked Questions (FAQs) available for you to find information on working and living in Saudi Arabia. Click on the individual headings to bring up relevant questions on different topics.&nbsp;</p>','<p>In an emergency upon arrival, please contact: {contact_employee} on {employee_mobile}.</p>','<p>Check your tasks (link at the top of your screen) for what to do next.</p>\r\n<p>If you still have problems, email us at&nbsp;<a href=\"mailto:qehcrecrutiment@qehc.edu.sa\">qehcrecruiters@qehc.edu.sa</a>.</p>','<p>stop editing</p>','<p>PRIVACY STATEMENT</p>\r\n<p>----</p>\r\n<p>SECTION 1 - WHAT DO WE DO WITH YOUR INFORMATION?</p>\r\n<p>When you purchase something from our store, as part of the buying and selling process, we collect the personal information you give us such as your name, address and email address.</p>\r\n<p>When you browse our store, we also automatically receive your computer&rsquo;s internet protocol (IP) address in order to provide us with information that helps us learn about your browser and operating system.</p>\r\n<p>Email marketing (if applicable): With your permission, we may send you emails about our store, new products and other updates.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 2 - CONSENT</p>\r\n<p>How do you get my consent?</p>\r\n<p>When you provide us with personal information to complete a transaction, verify your credit card, place an order, arrange for a delivery or return a purchase, we imply that you consent to our collecting it and using it for that specific reason only.</p>\r\n<p>If we ask for your personal information for a secondary reason, like marketing, we will either ask you directly for your expressed consent, or provide you with an opportunity to say no.</p>\r\n<p>&nbsp;</p>\r\n<p>How do I withdraw my consent?</p>\r\n<p>If after you opt-in, you change your mind, you may withdraw your consent for us to contact you, for the continued collection, use or disclosure of your information, at anytime, by contacting us at support@shopify.com or mailing us at: Shopify 126 York Street, Suite 200 Ottawa Ontario Canada K1N 5T5</p>\r\n<p><br />SECTION 3 - DISCLOSURE</p>\r\n<p>We may disclose your personal information if we are required by law to do so or if you violate our Terms of Service.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 4 - SHOPIFY&nbsp;</p>\r\n<p>Our store is hosted on Shopify Inc. They provide us with the online e-commerce platform that allows us to sell our products and services to you.</p>\r\n<p>Your data is stored through Shopify&rsquo;s data storage, databases and the general Shopify application. They store your data on a secure server behind a firewall.</p>\r\n<p>&nbsp;</p>\r\n<p>Payment:</p>\r\n<p>If you choose a direct payment gateway to complete your purchase, then Shopify stores your credit card data. It is encrypted through the Payment Card Industry Data Security Standard (PCI-DSS). Your purchase transaction data is stored only as long as is necessary to complete your purchase transaction. After that is complete, your purchase transaction information is deleted.</p>\r\n<p>All direct payment gateways adhere to the standards set by PCI-DSS as managed by the PCI Security Standards Council, which is a joint effort of brands like Visa, MasterCard, American Express and Discover.</p>\r\n<p>PCI-DSS requirements help ensure the secure handling of credit card information by our store and its service providers.</p>\r\n<p>For more insight, you may also want to read Shopify&rsquo;s Terms of Service here or Privacy Statement here.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 5 - THIRD-PARTY SERVICES</p>\r\n<p>In general, the third-party providers used by us will only collect, use and disclose your information to the extent necessary to allow them to perform the services they provide to us.</p>\r\n<p>However, certain third-party service providers, such as payment gateways and other payment transaction processors, have their own privacy policies in respect to the information we are required to provide to them for your purchase-related transactions.</p>\r\n<p>For these providers, we recommend that you read their privacy policies so you can understand the manner in which your personal information will be handled by these providers.</p>\r\n<p>In particular, remember that certain providers may be located in or have facilities that are located a different jurisdiction than either you or us. So if you elect to proceed with a transaction that involves the services of a third-party service provider, then your information may become subject to the laws of the jurisdiction(s) in which that service provider or its facilities are located.</p>\r\n<p>As an example, if you are located in Canada and your transaction is processed by a payment gateway located in the United States, then your personal information used in completing that transaction may be subject to disclosure under United States legislation, including the Patriot Act.</p>\r\n<p>Once you leave our store&rsquo;s website or are redirected to a third-party website or application, you are no longer governed by this Privacy Policy or our website&rsquo;s Terms of Service.</p>\r\n<p>&nbsp;</p>\r\n<p>Links</p>\r\n<p>When you click on links on our store, they may direct you away from our site. We are not responsible for the privacy practices of other sites and encourage you to read their privacy statements.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 6 - SECURITY&nbsp;</p>\r\n<p>To protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered or destroyed.</p>\r\n<p>If you provide us with your credit card information, the information is encrypted using secure socket layer technology (SSL) and stored with a AES-256 encryption. Although no method of transmission over the Internet or electronic storage is 100% secure, we follow all PCI-DSS requirements and implement additional generally accepted industry standards.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 7 - COOKIES&nbsp;</p>\r\n<p>Here is a list of cookies that we use. We&rsquo;ve listed them here so you that you can choose if you want to opt-out of cookies or not.</p>\r\n<p>_session_id, unique token, sessional, Allows Shopify to store information about your session (referrer, landing page, etc).</p>\r\n<p>_shopify_visit, no data held, Persistent for 30 minutes from the last visit, Used by our website provider&rsquo;s internal stats tracker to record the number of visits</p>\r\n<p>_shopify_uniq, no data held, expires midnight (relative to the visitor) of the next day, Counts the number of visits to a store by a single customer.</p>\r\n<p>cart, unique token, persistent for 2 weeks, Stores information about the contents of your cart.</p>\r\n<p>_secure_session_id, unique token, sessional</p>\r\n<p>storefront_digest, unique token, indefinite If the shop has a password, this is used to determine if the current visitor has access.</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<p>SECTION 8 - AGE OF CONSENT</p>\r\n<p>By using this site, you represent that you are at least the age of majority in your state or province of residence, or that you are the age of majority in your state or province of residence and you have given us your consent to allow any of your minor dependents to use this site.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 9 - CHANGES TO THIS PRIVACY POLICY</p>\r\n<p>We reserve the right to modify this privacy policy at any time, so please review it frequently. Changes and clarifications will take effect immediately upon their posting on the website. If we make material changes to this policy, we will notify you here that it has been updated, so that you are aware of what information we collect, how we use it, and under what circumstances, if any, we use and/or disclose it.</p>\r\n<p>If our store is acquired or merged with another company, your information may be transferred to the new owners so that we may continue to sell products to you.</p>\r\n<p>&nbsp;</p>\r\n<p>QUESTIONS AND CONTACT INFORMATION&nbsp;</p>\r\n<p>If you would like to: access, correct, amend or delete any personal information we have about you, register a complaint, or simply want more information contact our Privacy Compliance Officer at support@shopify.com or by mail at Shopify</p>\r\n<p>[Re: Privacy Compliance Officer]</p>\r\n<p>[126 York Street, Suite 200 Ottawa Ontario Canada K1N 5T5]</p>','<p>TERMS OF SERVICE</p>\r\n<p>-----&nbsp;</p>\r\n<p>OVERVIEW</p>\r\n<p>This website is operated by Shopify. Throughout the site, the terms &ldquo;we&rdquo;, &ldquo;us&rdquo; and &ldquo;our&rdquo; refer to Shopify. Shopify offers this website, including all information, tools and services available from this site to you, the user, conditioned upon your acceptance of all terms, conditions, policies and notices stated here.</p>\r\n<p>By visiting our site and/ or purchasing something from us, you engage in our &ldquo;Service&rdquo; and agree to be bound by the following terms and conditions (&ldquo;Terms of Service&rdquo;, &ldquo;Terms&rdquo;), including those additional terms and conditions and policies referenced herein and/or available by hyperlink. These Terms of Service apply to all users of the site, including without limitation users who are browsers, vendors, customers, merchants, and/ or contributors of content.</p>\r\n<p>Please read these Terms of Service carefully before accessing or using our website. By accessing or using any part of the site, you agree to be bound by these Terms of Service. If you do not agree to all the terms and conditions of this agreement, then you may not access the website or use any services. If these Terms of Service are considered an offer, acceptance is expressly limited to these Terms of Service.</p>\r\n<p>Any new features or tools which are added to the current store shall also be subject to the Terms of Service. You can review the most current version of the Terms of Service at any time on this page. We reserve the right to update, change or replace any part of these Terms of Service by posting updates and/or changes to our website. It is your responsibility to check this page periodically for changes. Your continued use of or access to the website following the posting of any changes constitutes acceptance of those changes.</p>\r\n<p>&nbsp;</p>\r\n<p>Our store is hosted on Shopify Inc. They provide us with the online e-commerce platform that allows us to sell our products and services to you.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 1 - ONLINE STORE TERMS&nbsp;</p>\r\n<p>By agreeing to these Terms of Service, you represent that you are at least the age of majority in your state or province of residence, or that you are the age of majority in your state or province of residence and you have given us your consent to allow any of your minor dependents to use this site.</p>\r\n<p>You may not use our products for any illegal or unauthorized purpose nor may you, in the use of the Service, violate any laws in your jurisdiction (including but not limited to copyright laws).</p>\r\n<p>You must not transmit any worms or viruses or any code of a destructive nature.</p>\r\n<p>A breach or violation of any of the Terms will result in an immediate termination of your Services.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 2 - GENERAL CONDITIONS</p>\r\n<p>We reserve the right to refuse service to anyone for any reason at any time.</p>\r\n<p>You understand that your content (not including credit card information), may be transferred unencrypted and involve (a) transmissions over various networks; and (b) changes to conform and adapt to technical requirements of connecting networks or devices. Credit card information is always encrypted during transfer over networks.</p>\r\n<p>You agree not to reproduce, duplicate, copy, sell, resell or exploit any portion of the Service, use of the Service, or access to the Service or any contact on the website through which the service is provided, without express written permission by us.</p>\r\n<p>The headings used in this agreement are included for convenience only and will not limit or otherwise affect these Terms.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 3 - ACCURACY, COMPLETENESS AND TIMELINESS OF INFORMATION</p>\r\n<p>We are not responsible if information made available on this site is not accurate, complete or current. The material on this site is provided for general information only and should not be relied upon or used as the sole basis for making decisions without consulting primary, more accurate, more complete or more timely sources of information. Any reliance on the material on this site is at your own risk.</p>\r\n<p>This site may contain certain historical information. Historical information, necessarily, is not current and is provided for your reference only. We reserve the right to modify the contents of this site at any time, but we have no obligation to update any information on our site. You agree that it is your responsibility to monitor changes to our site.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 4 - MODIFICATIONS TO THE SERVICE AND PRICES</p>\r\n<p>Prices for our products are subject to change without notice.</p>\r\n<p>We reserve the right at any time to modify or discontinue the Service (or any part or content thereof) without notice at any time.</p>\r\n<p>We shall not be liable to you or to any third-party for any modification, price change, suspension or discontinuance of the Service.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 5 - PRODUCTS OR SERVICES (if applicable)</p>\r\n<p>Certain products or services may be available exclusively online through the website. These products or services may have limited quantities and are subject to return or exchange only according to our Return Policy.</p>\r\n<p>We have made every effort to display as accurately as possible the colors and images of our products that appear at the store. We cannot guarantee that your computer monitor\'s display of any color will be accurate.</p>\r\n<p>We reserve the right, but are not obligated, to limit the sales of our products or Services to any person, geographic region or jurisdiction. We may exercise this right on a case-by-case basis. We reserve the right to limit the quantities of any products or services that we offer. All descriptions of products or product pricing are subject to change at anytime without notice, at the sole discretion of us. We reserve the right to discontinue any product at any time. Any offer for any product or service made on this site is void where prohibited.</p>\r\n<p>We do not warrant that the quality of any products, services, information, or other material purchased or obtained by you will meet your expectations, or that any errors in the Service will be corrected.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 6 - ACCURACY OF BILLING AND ACCOUNT INFORMATION</p>\r\n<p>We reserve the right to refuse any order you place with us. We may, in our sole discretion, limit or cancel quantities purchased per person, per household or per order. These restrictions may include orders placed by or under the same customer account, the same credit card, and/or orders that use the same billing and/or shipping address. In the event that we make a change to or cancel an order, we may attempt to notify you by contacting the e-mail and/or billing address/phone number provided at the time the order was made. We reserve the right to limit or prohibit orders that, in our sole judgment, appear to be placed by dealers, resellers or distributors.</p>\r\n<p>&nbsp;</p>\r\n<p>You agree to provide current, complete and accurate purchase and account information for all purchases made at our store. You agree to promptly update your account and other information, including your email address and credit card numbers and expiration dates, so that we can complete your transactions and contact you as needed.</p>\r\n<p>&nbsp;</p>\r\n<p>For more detail, please review our Returns Policy.</p>\r\n<p>&nbsp;</p>\r\n<p>SECTION 7 - OPTIONAL TOOLS</p>\r\n<p>We may provide you with access to third-party tools over which we neither monitor nor have any control nor input.</p>\r\n<p>You acknowledge and agree that we provide access to such tools &rdquo;as is&rdquo; and &ldquo;as available&rdquo; without any warranties, representations or conditions of any kind and without any endorsement. We shall have no liability whatsoever arising from or relating to your use of optional third-party tools.</p>\r\n<p>Any use by you of optional tools offered through the site is