INSERT INTO `user_workhistory` VALUES (1,3,'Greenwood University','2009-02-03','2012-08-14','Salay was too low','Registrar','- Manage the Office of Admissions and Records for this community college with student enrollment of 12,500.\r\n- Monitor and report changes in enrollment to State Chancellor\'s office to determine level of college funding.\r\n- Provide database management for admissions, touch-tone and in-person registration, permanent records, transcripts, and degree/graduation audits.\r\n- Direct the consolidation of user access to student academic data, in keeping with federal privacy provisions.\r\n- Serve on several committees and act as resource to college committees, administrators, faculty, and staff.\r\n- Publish the course directory for the fall and spring semesters and summer session.\r\n- Advise students regarding academic options.','education',2,'2015-05-19 03:49:45','2015-05-19 03:49:45'),(2,3,'DAYSIDE COLLEGE','2012-09-01','2015-05-01','Want to travel and work abroad','Learner Relations Coordinator','- Established and managed a fully functioning Registrar\'s Office on a new satellite campus composed entirely of international students.\r\n- Coordinated the development of a computer link between satellite and main campuses.\r\n- Managed class scheduling and publication of course directory and college bulletin.\r\n- Generated college and federal enrolment reports.\r\n- Trained and supervised staff on college transfer policies and evaluations.\r\n- Revised the Dayside Transfer Guide.\r\n- Certified students for athletic eligibility.','education',2,'2015-05-19 03:52:08','2015-05-19 03:52:08'),(3,1,'DAYSIDE COLLEGE','2012-09-01','2015-05-01','Want to travel and work abroad','Learner Relations Coordinator','- Established and managed a fully functioning Registrar\'s Office on a new satellite campus composed entirely of international students.\r\n- Coordinated the development of a computer link between satellite and main campuses.\r\n- Managed class sche